import React from 'react';
import TodoList from './TodoList'

function App() {
  const [todos, setTodos] = useState(['todo1', 'todo2'])
  return (
    <>
      <TodoList todos = {todos} />
      <input type ='text'/>
      <button>Add Todo</button>
      <button>Clear Complete</button>
      <div>0 left to do</div>
    </>
  )
}

export default App;
